class VotingFuserPolicyTest(unittest.TestCase):
    def setUp(self):
        pass

    def tearDown(self):
        pass

    def test_fuse(self):
        temporary_working_directory = tempfile.TemporaryDirectory()
        shutil.copy(os.path.join(THIS_DIRECTORY_PATH, PREDICT_EXECUTABLE_FILE), temporary_working_directory.name)
        os.environ['CCUBE_PREDICT_WORKING_DIRECTORY'] = temporary_working_directory.name

        predictions_file_path = os.path.expandvars(PREDICT_PREDICTIONS_FILE)

        models_executors = []
        for model_files_stream in MODELS_FILES_STREAMS:
            models_executors.append(
                ModelExecutor(
                    model_files_stream=model_files_stream,
                    model_parameters=None,
                    predictions_file_path=predictions_file_path,
                    execution_command=PREDICT_COMMAND,
                    working_directory=temporary_working_directory.name,
                    environment_variables=os.environ,
                )
            )

        test_actual_values_stream = io.BytesIO(TEST_ACTUAL_VALUES_STRING.encode())
        test_actual_values = utils.read_values_from_file(test_actual_values_stream)

        test_data_file = tempfile.NamedTemporaryFile()
        test_data_file.write(TEST_DATA_STRING)
        test_data_file.flush()
        test_data_file.seek(0)

        fuser_policy = VotingFuserPolicy(
            models_executors=models_executors,
            training_data=None,
            training_actual_values=None,
            test_data=test_data_file.name,
            test_actual_values=test_actual_values,
            true_class_value=TRUE_CLASS_VALUE,
            class_attribute_type=CLASS_ATTRIBUTE_TYPE,
            configuration=None,
        )
        metrics = fuser_policy.fuse()
        pprint(metrics)
